body:
Fix the bugs where gride_size type in voxelize custom op is set as float but supposed to be int, otherwise, coordinates may be computed repeatlly.

For example, when `grid_idx = 82249485, grid_size_x = 1440.000000, 1440, grid_size_y = 1440.000000, grid_size_z = 41.000000`, the result of following codes when `grid_size_x/grid_size_y/grid_size_z` is float type differs with the one when `grid_size_x/grid_size_y/grid_size_z` is int type:

```
T_int coord_z = grid_idx / grid_size_x / grid_size_y;
T_int coord_y =
    (grid_idx - coord_z * grid_size_x * grid_size_y) / grid_size_x;
T_int coord_x =
    grid_idx - coord_z * grid_size_x * grid_size_y - coord_y * grid_size_x;
```

If `grid_size_x/grid_size_y/grid_size_z` is set as float type, different `grid_idx` would be computed as the same `coord_z/coord_y/coord_x` , which is not supposed to be right.
